import classes from "../components/ExperienceCard.module.css"

function ExperienceCard(props) {
    return (
        <div className={classes.card}>
            <h2>{props.time}</h2>
            <div>
            <p>{props.title}</p>
            <p>{props.company}</p>
            {props.children}
            </div>
        </div>
    )
}

export default ExperienceCard
